import React from 'react';
import Beer from './beer';
import ChristianDrinking from '../../images/team/ChristianDrinking.jpg';

const HeaderSection = () => {
  return(
      <div className="row">
        <div className="col">
          <Beer />
        </div>
        <div className="col">
          <img src={ChristianDrinking} />
        </div>
      </div>
  )
}

export default HeaderSection;
